import React,{useState} from "react";

function Login(){
const[text,setText]=useState(
    {login:"",
    password:"",
    phone:"",
    name:"",
    surname:""},
    )

    return(

    <div className="login">
  
            <div className="input_surname">
    <input type="text" value={text.name} className="input_name" placeholder="Ваше имя" onChange={e=>setText(function(p){
        return {...p,name:e.target.value}
    })}> </input>
    <input  type="text" value={text.surname} className="input_name" placeholder="Ваша фамилия" ></input>
    
            </div>

    <div className="input_logpass">
    
    
    <input type="text"  value={text.phone} className="input" placeholder="Введите номер телефона" onChange={(event)=>setText( ...{phone:event.target.value})}></input>
    <input  type="text"value={text.login} className="input" placeholder="Введите логин" onChange={(event)=>setText( ...{login:event.target.value})}></input>
    <input type="text" value={text.password} className="input" placeholder="Введите пароль" onChange={(event)=>setText( ...{password:event.target.value})}></input>
    
    
    </div>
    <div><button className="Button_reg">Зарегистрироваться</button></div>
    </div>

    )
}
export default Login
